A área do triângulo $OAB$ é a metade da área do paralelogramo $OACB,$ onde $C$ é o ponto tal que $\overrightarrow{OC} = \overrightarrow{OA} + \overrightarrow{OB}.$

\begin{align*}
\overrightarrow{OC} &= \begin{pmatrix} 1 \\ 2 \\ 3 \end{pmatrix} + \begin{pmatrix} -3 \\ -2 \\ 1 \end{pmatrix} \\
&= \begin{pmatrix} -2 \\ 0 \\ 4 \end{pmatrix}.
\end{align*}

A área do paralelogramo $OACB$ é a magnitude do vetor $\overrightarrow{AB} = \overrightarrow{OB} - \overrightarrow{OA} = \begin{pmatrix} -4 \\ -4 \\ -2 \end{pmatrix}.$

\begin{align*}
\text{Área do paralelogramo} &= \left\| \begin{pmatrix} -4 \\ -4 \\ -2 \end{pmatrix} \right\| \\
&= \sqrt{(-4)^2 + (-4)^2 + (-2)^2} \\
&= \sqrt{36} \\
&= 6.
\end{align*}

Portanto, a área do triângulo $OAB$ é $\frac{1}{2} \cdot 6 = \boxed{3}.$

Note que $450 = 2 \cdot 3^2 \cdot 5^2$. Para que um número possa ser divisível por 2, deve ter um dígito par; para que ele possa ser divisível por 3, a soma dos dígitos deve ser divisível por 3; e para que ele possa ser divisível por 5, deve terminar em zero. Portanto, o menor número que satisfaz as condições é $111000$.  \[
\boxed{111000}
\]

