A região retangular com os pontos dadas é formada por $11$ linhas paralelas verticais e $9$ linhas paralelas horizontais. Assim, a região retangular tem $11\cdot9=99$ pontos de interseção. A região retangular com os pontos dadas contém $9$ pontos de interseção no eixo $x$ e $11$ pontos de interseção no eixo $y$. Assim, a região retangular com os pontos dadas contém $9+11-1=19$ pontos de interseção no eixo $x$ ou no eixo $y$. Portanto, a região retangular com os pontos dadas contém $99-19=80$ pontos de interseção no interior da região retangular. $\boxed{80}$

Note that $\angle BAC = \angle BDM$ and $\angle BDC = 3\angle BAC = 3\angle BDM.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);
draw(D--M);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

Let $x = \angle BDM.$ Then $\angle BDC = 3x,$ so $\angle BCD = 180^\circ - 3x - x = 180^\circ - 4x.$

