draw(A--M);
draw(B--D--C);
draw(D--M);
draw(C--M);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
label("$x$", (B + D)/2, NW);
label("$x$", (D + M)/2, W);
label("$x$", (M + C)/2, NE);
label("$180^\circ - 4x$", (C + M)/2, E);
[/asy]

Since $\angle BAC = \angle BDM = x,$ $\angle ABC = 180^\circ - 2x.$

