label("$180^\circ - 4x$", (C + M)/2, E);
[/asy]

Since $AB = AC,$ $\angle ABC = \angle ACB = 180^\circ - 2x.$ Therefore, $\angle BCA = 180^\circ - 2x = \angle ACB = \angle BAC,$ so $\triangle ABC$ is equilateral. Thus, $AB = AC = BC.$

